import React from 'react';

import {MDBNavItem, MDBNavLink} from 'mdbreact';
const LogIn = () => {
  return (
    <>
      <MDBNavItem>
        <MDBNavLink to='/create'>New List</MDBNavLink>
      </MDBNavItem>
    </>
  );
};

export default LogIn;
